import React from 'react'
import Item from "./Item"
import Header from "./Header"
import todosData from "./toDos"


class App extends React.Component{
    render(){
        let todos = todosData.map(function(element){
            return <Item name = {element.text} check = {element.completed}/>
        });

        return (
            <div>
                <Header/>
                {todos}
            </div>

        );
    }
}

export default App;
